import React, {useContext, useEffect} from 'react';
import {Context} from "../../index";
import {Button, Col, Row} from "antd";
import ParametersBar from "../../components/home/ParametersBar";
import EventList from "../../components/home/EventList";
import Orders from "../../components/user/orders";
import Profile from "../../components/user/profile";
import {fetchOneEvent} from "../../http/eventAPI";
import {getInfo} from "../../http/userAPI";
import {observer} from "mobx-react-lite";
import {LogoutOutlined} from "@ant-design/icons";

const User = () => {
    const {user} = useContext(Context)


    return (
        <Row className="mt-3">
            <Col md={8} style={{margin:"2em", marginBottom: 0}}>
                <Button
                    block
                    style={{margin:"2em", marginBottom: 0}}
                >
                    Выйти из аккаунта<LogoutOutlined/>
                </Button>
                <Profile/>
            </Col>
            <Col md={16}>
                <Orders/>
            </Col>

        </Row>
    );
};

export default observer(User);
